import './App.css';
import React, { useState } from 'react';

function App() {

      const initialValues = {username:'', email: '', password: ''};
      const [] = useState();


      return (
            <div className="App">
                <h1 className="title">Form Validation</h1>
                <form>
                    <div className="form-validation">
                        <label>Username</label>
                        <input id="username" className='modul-input' type="text" name="username" placeholder="Username" />
                    </div>

                    <div className="form-validation">
                        <label>Email</label>
                        <input id="email" className='modul-input' type="email" name="email" placeholder="Email Adresse" />
                    </div>

                    <div className="form-validation">
                        <label>Password</label>
                        <input id="password" className='modul-input' type="password" name="password" placeholder="Password" />
                    </div>

                    <button className='valid-btn'>Valid</button>
                </form>
            </div>
      );
}

export default App;
